import "./App.css";
import {Link, Element} from 'react-scroll';
import { configure } from "@testing-library/react";
import Home from "./components/Home";
import About from "./components/About";
import Projects from "./components/Projects";
import Resume from "./components/Resume";
import React, {Fragment} from 'react';
import HeaderComponent from "./components/HeaderComponent";

function App() {
  const navItems = [
    {
      id: 1,
      title: "Home",
      component: <Home/>,
    },
    {
      id: 2,
      title: "About",
      component: <About/>,
    },
    {
      id: 3,
      title: "Projects",
      component: <Projects/>,
    },
    {
      id: 4,
      title: "Resume",
      component: <Resume/>,
    }
  ]

  return (
    <div className="App">
      <header>
        <nav>
          <ul>
            {navItems.map((item) => (
              <li>
                <Link to={item.title} smooth="true" offset={-80} duration={800} activeClass='active' spy={true}>{item.title}</Link>
              </li>
            ))}
          </ul>
        </nav>
      </header>

      <main>
        {navItems.map(item => (
          <Element offset={-50} name={item.title}>
            <div className="content">
              {item.title != "Home" &&
              <HeaderComponent name={item.title}/>
              }
              <React.Fragment key={item.id}>
                { item.component }
              </React.Fragment>
            </div>
          </Element>
        ))}
      </main>
    </div>
  );
}



export default App;
